features.script:
let msg = parcel.getFeatureById('welcomeSign')

parcel.on('playerenter', event => {
  msg.set({text:`Welcome ${event.player.name}`})
})

parcel.on('playerleave', event => {
  msg.set({text:`Goodbye ${event.player.name}`})
})

